import { QueryClient, QueryClientProvider } from 'react-query';
import './App.css';
import ReactHookForm from './Components/ReactHookForm';

function App() {
  return (
    <QueryClientProvider client={new QueryClient}>
      <ReactHookForm />
    </QueryClientProvider>
  );
}

export default App;
